import React from 'react';
import logo from './../../reddit-logo.svg';
import SearchBar from './searchBar/searchbar';
import NightMode from './nightModeToggle/nightModeToggle';
import './head.css'
import { useSelector } from 'react-redux';
import { selectMemes } from '../../app/memesSlice';
import { useDispatch } from 'react-redux';
import { loading } from '../../app/loadingSlice';

function Head() {

  const dispatch= useDispatch();
  const memesArr = useSelector(selectMemes);
  if(memesArr.length > 0){
    dispatch(loading.actions.setLoading)
  }


  return (
    <nav className={'head'}>
      <div className={'logo-div'} >
        <img src={logo} className={'logo'}  alt={'Reddit logo'}></img>
      </div>
        <SearchBar />
        <NightMode />
    </nav>
  );
}

export default Head;
